import base64

data_uri = "data:image/png;base64,"  # your full data URI here

header, encoded = data_uri.split(',', 1)

# Fix base64 padding
missing_padding = len(encoded) % 4
if missing_padding:
    encoded += '=' * (4 - missing_padding)

image_data = base64.b64decode(encoded)

with open("secret-code.png", "wb") as f:
    f.write(image_data)

print("Image saved as output.png")
